import React from 'react'
import Rate from './ratings'

export default class List extends React.Component{
	constructor(props){
		super(props) 
}


	render(){
        // console.log(this.props)
        var lol=this.props.buyers

        const Ratings=
          lol.map(item => <Rate itm={item}/>)   

		return(
  		<div>


        <a  style={{margin:'5px'}} className="list-group-item list-group-item-action flex-column align-items-start">
         <div className="d-flex w-100 justify-content-between">
          <h5 className="mb-1">{this.props.itm.listname}</h5>
         </div>

         {Ratings}
         <p className="mb-1">{this.props.username}</p>
         <small>{this.props.review}</small>


          <span className="badge badge-success badge-pill" >Rating : {this.props.rating}</span>




        </a>

      </div>
		);
  }
}
